import React from 'react';

export default class Table extends React.Component {

    constructor() {
        super()

        this.listItems = this.props.map((el) =>
            <tr>
                <td>{el.fname}</td>
                <td>{el.lname}</td>
            </tr>
        );
    }

    render(props) {
        return (
            <table>
                <thead>
                    <tr>
                        <th>name</th>
                        <th>last name</th>
                    </tr>
                </thead>
                <tbody>
                    {this.listItems}
                </tbody>
            </table>
        );
    }
}
